package com.amandris.clients.service.vo;import java.io.Serializable;import java.util.Date;public class SellerPromotion implements Serializable{	private Integer 	id;	private Integer 	sellerId;	private Integer 	promotionConst;	private Date  		startDate;	private Date 		endDate;	private Seller 		seller;		private static final long serialVersionUID = 6526471155622776017L;		public Date getEndDate() {		return endDate;	}	public void setEndDate(Date endDate) {		this.endDate = endDate;	}	public Integer getId() {		return id;	}	public void setId(Integer id) {		this.id = id;	}	public Integer getPromotionConst() {		return promotionConst;	}	public void setPromotionConst(Integer promotionConst) {		this.promotionConst = promotionConst;	}	public Seller getSeller() {		return seller;	}	public void setSeller(Seller seller) {		this.seller = seller;	}	public Integer getSellerId() {		return sellerId;	}	public void setSellerId(Integer sellerId) {		this.sellerId = sellerId;	}	public Date getStartDate() {		return startDate;	}	public void setStartDate(Date startDate) {		this.startDate = startDate;	}}